tstofffenster\r\n- 5 Garagen\r\n- Großzügiger Außenbereich','Daten zum Objekt:\r\nBaujahr 1963 Haupthaus \r\nAnbau 1966 Seitengebäude, das ist direkt die Wohnung wenn man rein geht links auf der seite.\r\nGrundstücksgröße= ca. 1.382\r\nWohnfläche Vorderhaus ca. 320 m²\r\nWohnfläche Anbau ca. 90m²\r\nSparkasse ca. 102m²\r\nInsgesamt ca. 512m²\r\n\r\n5 Garagen stehen zur Verfügung jede davon kostet monatlich 25 EUR.\r\nMietvertrag Sparkasse ist bis 2018, + 5 Jahres Option bis 2023\r\nÖltank davon gibt’s zwei mit insgesamt Fassungsmögen von 14. Tsd Liter.\r\n\r\n\r\nZusammenfassung:\r\n\r\n 5 Wohnungen und ein Gewerbe\r\n- Die Küchenböden sind gefliest\r\n- Wohn/Schlafräume sind mit Laminat verlegt\r\n- Alle Fenster mit Rollladen\r\n- Doppelverglaste-Kunststofffenster\r\n- 5 Garagen\r\n- Großzügiger Außenbereich',0,1390840936),(135,'Objekte',62,'Breuberg Wohn- und Geschäftshaus','Manu',NULL,'c_provision','','Provision wird mit dem Käufer vereinbart',0,1390840936),(136,'Objekte',64,'Frankfurt, Hanauer Landstraße + Theobald Straße','Manu',NULL,'c_price','5800000.00','580000000',0,1390926463),(137,'Objekte',64,'Frankfurt, Hanauer Landstraße + Theobald Straße','Manu',NULL,'c_provision','5,95% inkl. MwSt.','4,76% inkl. MwSt.',0,1390926463);
