INSERT INTO `x2_docs` VALUES (52,'Sample Quote Template',NULL,'quote','<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body style=\"width:1000px\">\r\n<table cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><span style=\"font-size: 36px;\">Sales {Quote.quoteOrInvoice}: {Quote.name}</span></td>\r\n			<td style=\"text-align: right;\">{Quote.quoteOrInvoice} #{Quote.id}<br />\r\n			{Quote.createDate}</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align: left\">Customer:</td>\r\n			<td style=\"text-align: left; font-weight: bold;\">{Contact.name}</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td style=\"text-align: left;\">{Contact.address}</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td style=\"text-align: left;\">{Contact.city},&nbsp;{Contact.state}&nbsp;{Contact.zipcode}</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<hr />{Quote.description}<br /><br />\r\n{Quote.lineItems}</body>\r\n</html>','Anyone',1367966539,'Anyone','Anyone',1367966539,1),(53,'TEST',NULL,'','<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>&nbsp;</body>\r\n</html>\r\n','Manu',1389606334,NULL,'Manu',1389606334,1);
