  `color` varchar(10) DEFAULT NULL,
  `fontColor` varchar(10) DEFAULT NULL,
  `linkColor` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=1057 DEFAULT CHARSET=utf8;
