NULL,NULL,NULL),(808,'calendar_event',NULL,NULL,1,NULL,'Actions',3,NULL,1388663483,1388663483,0,0,NULL,NULL,NULL),(809,'calendar_event',NULL,NULL,1,NULL,'Actions',4,NULL,1388663537,1388663537,0,0,NULL,NULL,NULL),(810,'calendar_event',NULL,NULL,1,NULL,'Actions',5,NULL,1388663575,1388663575,0,0,NULL,NULL,NULL),(811,'calendar_event',NULL,NULL,1,NULL,'Actions',6,NULL,1389351641,1388663742,0,0,NULL,NULL,NULL),(812,'calendar_event',NULL,NULL,1,NULL,'Actions',7,NULL,1389088809,1388663889,0,0,NULL,NULL,NULL),(813,'feed','Social Post',NULL,1,'*1* Interessante Urteile &amp; Neues<br />\n&nbsp;<br />\n*2* Das Thema des Monats<br />\n&nbsp;<br />\n*3* Neues bei AnwaltOnline &amp; mehr<br />\n&nbsp;<br />\n*4* Kontakt / Premiuminhalte<br />\n&nbsp;<br />\n*5* Impressum und Haftungsausschluss<br />\n&nbsp;<br />\n************************************************************************<br />\n&nbsp;<br />\n*1* Interessante Urteile &amp; Neues<br />\n&nbsp;<br />\n&nbsp; &gt;&gt; Mieterh&ouml;hung von &uuml;ber 100% kann zul&auml;ssig sein!<br />\n&nbsp;<br />\nIm vorliegenden Fall ging es um einen Mietvertrag, nach dem die Wohnungsgr&ouml;&szlig;e 81,36 m&sup2; betrug. Tats&auml;chlich hatte die Wohnung jedoch<br />\n143,48 m&sup2;. Der Vermieter wollte nun die Miete von 4,18 &euro;/m&sup2; f&uuml;r die vereinbarte Wohnungsgr&ouml;&szlig;e auf 5,01 &euro;/m&sup2; erh&ouml;hen. Dies w&auml;re zul&auml;ssig gewesen und entspr. dem Mietspiegel. Doch nun sollte auch die tats&auml;chliche Wohnungsgr&ouml;&szlig;e ber&uuml;cksichtigt werden, so dass die Gesamtmiete sich von 340 &euro; auf 718,83 &euro; erh&ouml;ht werden sollte - mithin um satte 111%.<br />\n&nbsp;<br />\nDer Vermieter muss sich nicht dauerhaft f&uuml;r eine f&uuml;r ihn unzumutbaren vertraglichen Vereinbarung &uuml;ber die Wohnfl&auml;che halten. Bei einer Mieterh&ouml;hung kann daher die tats&auml;chliche Wohnungsgr&ouml;&szlig;e angesetzt werden, sofern die vertraglich vereinbarte Wohnungsgr&ouml;&szlig;e um mehr als 10% von der tats&auml;chlichen Gr&ouml;&szlig;e &uuml;berschritten wird. Schlie&szlig;lich stellt die Entdeckung des Kalkulationsirrtums keinen K&uuml;ndigungsgrund f&uuml;r den Vermieter dar (vgl. BGH, 23.5.2007 - VIII ZR 138/06).<br />\n&nbsp;<br />\nDie Folge: Die vom Vermieter ausgesprochene Mieterh&ouml;hung war wirksam.<br />\n&nbsp;<br />\nLG Halle, 19.3.2013 - Az: 2 S 263/12<br />\n&nbsp;<br />\n&nbsp; &gt;&gt; Wenn Wasser und Gas und Heizung ausfallen, gibt&#39;s keine Miete!<br />\n&nbsp;<br />\nIm vorliegenden Fall war es im Rahmen einer Modernisierungsma&szlig;nahme zu einer Unterbrechung der Wasser- und Gasversorgung gekommen. Es konnte daher weder gekocht noch geheizt werden. Dies rechtfertigt in der Heizperiode eine Mietminderung von 100% (20% f&uuml;r die fehlende Wasserversorgung, 10% f&uuml;r den Ausfall des Herdes, 70% f&uuml;r den Heizungsausfall).<br />\n&nbsp;<br />\nLG Berlin, 18.8.2002 - Az: 67 T 70/02<br />\n&nbsp;<br />\n&nbsp; &gt;&gt; Feuchter Keller im Altbau - Mangel oder nicht?<br />\n&nbsp;<br />\nDa in Altbauten (vorliegend: Baujahr 1923) durchaus mit Feuchtigkeit im Keller zu rechnen ist, kann ein Mieter daher nicht wegen feuchten Kellerw&auml;nden die Miete mindern. Will der Mieter n&auml;mlich einen solchen Bausubstanzmangel monieren, so kommt es im &uuml;brigen auch auf das Baujahr des Geb&auml;udes und die zu diesem Zeitpunkt bestehenden Vorschriften an.<br />\nVorliegend bestand zum Errichtungszeitpunkt weder eine DIN-Richtlinie noch hab es Regelungen in der Bauordnung zum Feuchtigkeitsschutz.<br />\nNicht hinzunehmen w&auml;re indes eine Schimmelbildung, diese muss der Mieter jedoch nachweisen - was vorliegend nicht gelang.<br />\n&nbsp;<br />\nAG Ansbach, 5.2.2013 - Az: 2 C 2268/11<br />\n&nbsp;<br />\n&nbsp; &gt;&gt; Fristlose K&uuml;ndigung wegen unordentlichem Keller?<br />\n&nbsp;<br />\nIm vorliegenden Fall hatte ein Vermieter die fristlose K&uuml;ndigung ausgesprochen, weil der betroffene Mieter in seinem Keller Sperrm&uuml;ll lagerte und dieser nicht aufger&auml;umt war und der vermieterseitigen Aufforderung auf Entr&uuml;mpelung nicht nachgekommen wurde. Der Vermieter sorgte sich, dass Ratten, M&auml;use und Ungeziefer angelockt werden w&uuml;rden, weil im fraglichen Keller auf Paletten ruhend ein Schrank, St&uuml;hle, ein Tisch, eine alte Waschmaschine und Kartons gelagert wurden.<br />\nDer betroffene Mieter weigerte sich, die K&uuml;ndigung anzuerkennen - zu Recht. Die fristlose K&uuml;ndigung wurde vom Gericht kassiert. Ein unaufger&auml;umter Keller ist kein K&uuml;ndigungsgrund und stellt auch nicht zwangsl&auml;ufig eine Gef&auml;hrdung der Mietsache dar. Zudem ist es Sache des Mieters, welche Sachen in welcher Art und Weise in seinem Keller gelagert werden, solange keine Sch&auml;den an der Mietsache drohen oder bereits eingetreten sind. Dass Ungeziefer und Nagetiere angelockt werden, ist im &uuml;brigen insbes. nur bei Lagerung von (verdorbenen) Lebensmitteln zu erwarten.<br />\n&nbsp;<br />\nAG Frankfurt/Main, 29.8.2012 - Az: 33 C 2163/12 (93)<br />\n&nbsp;<br />\n&nbsp; &gt;&gt; &Uuml;berm&auml;&szlig;ig viele D&uuml;bell&ouml;cher - Anspruch auf Schadenersatz!<br />\n&nbsp;<br />\nMuss ein Vermieter &uuml;berm&auml;&szlig;ig viele D&uuml;bell&ouml;cher &uuml;bermalen, so hat er Anspruch auf Schadensersatz in H&ouml;he der Farbkosten. Konkret ging es vorliegend um 10-15 D&uuml;bell&ouml;cher in der K&uuml;che und 50-60 in einem anderen Zimmer. Die Mieter unterlie&szlig;en es, die angebrachten D&uuml;bell&ouml;cher zu verschlie&szlig;en. Dies ist eine Verletzung der Pflicht zur ordnungsgem&auml;&szlig;en R&uuml;ckgabe, wenn die Anzahl der D&uuml;bell&ouml;cher nicht mehr zum vertragsgem&auml;&szlig;en Gebrauch geh&ouml;rt. In der K&uuml;che konnte das Gericht keine solche Verletzung erkennen, die Anzahl von 10-15 ist zur Anbringung von H&auml;ngeschr&auml;nken und Arbeitsplatten &uuml;blich. Die hohe Zahl von 50-60 L&ouml;cher im anderen Zimmer war jedoch &uuml;berm&auml;&szlig;ig.<br />\n&nbsp;<br />\nAG M&ouml;nchengladbach-Rheydt, 2.8.2012 - Az: 11 C 329/11<br />\n&nbsp;<br />\n&nbsp; &gt;&gt; Heizungsausfall im Winter - 70% Minderung<br />\n&nbsp;<br />\nIm vorliegenden Fall war in den Wintermonaten die Heizung ausgefallen.<br />\nDies ist ein erheblicher Mangel der Mietsache. Da zudem nach Einbau einer neuen Heizung nur unvollst&auml;ndig renoviert wurde, minderten die betroffenen Mieter die Miete. Da es hinsichtlich des Minderungsrechts zum Dissens zwischen den Parteien kam, musste das Gericht entscheiden.<br />\nDieses best&auml;tigte das Mietminderungsrecht. Ein Ausfall der Heizung in der Heizperiode (Oktober-April) ist ein erheblicher Mangel und berechtigt zur 70%-igen Minderung der Nettokaltmiete, da zu ber&uuml;cksichtigen war, dass die Mieter Gasheizungen aufgestellt hatten und eine halbwegs ertr&auml;gliche Zimmertemperatur gew&auml;hrleisten konnten. Da nach Einbau der neuen Heizung in der Tat nur unvollst&auml;ndig renoviert hatten und dies jeden einzelnen Raum betraf, konnte eine weitere Minderung i.H.v. 10% angesetzt werden.<br />\n&nbsp;<br />\nLG Berlin, 29.7.2002 - Az: 61 S 37/02<br />\n&nbsp;<br />\n&nbsp; &gt;&gt; Chronisches Schnarchen als Grund f&uuml;r Eigenbedarf<br />\n&nbsp;<br />\nIm vorliegenden Fall ging es um eine Eigenbedarfsk&uuml;ndigung eines Vermieters, der im selben Haus wohnte. Die Begr&uuml;ndung: er sei notorischer Schnarcher und k&ouml;nne seiner Frau nicht zumuten, mit ihm im gleichen Zimmer zu schlafen. Aufgrund des lauten Schnarchens m&uuml;sse seine Frau in der Nacht im Wohnzimmer schlafen. Deshalb werde ein weiteres Zimmer zum Schlafen ben&ouml;tigt. Das zust&auml;ndige Gericht folgte dem Begehren und erkl&auml;rte die K&uuml;ndigung f&uuml;r wirksam. Der Einwand, dass der Vermieter schon l&auml;nger schnarche, blieb erfolglos, da der Vermieter nachweisen konnte, dass er bei Vertragsschluss hoffte, das Problem medizinisch zu regeln und was er konkret hierzu unternommen hatte. Leider waren die Bem&uuml;hungen des Vermieters erfolglos geblieben.<br />\n&nbsp;<br />\nAG Sinzig, 6.5.1998 - Az: 4 C 1096/97<br />\n&nbsp;<br />\n&nbsp; &gt;&gt; Heizungsreparatur im Winter ist nicht immer eine Notma&szlig;nahme<br />\n&nbsp;<br />\nEin Heizungsausfall rechtfertigt auch im Winter keine Selbstreparatur durch den Mieter, wenn der Ausfall lediglich einen Tag andauert. Da der Vermieter in diesem Fall nicht im Verzug ist, fehlt es an einer Notwendigkeit zur Selbstvornahme und daher auch an einem Anspruch auf Ersatz der Reparaturkosten seitens des Mieters. Hierf&uuml;r h&auml;tte dem Vermieter zun&auml;chst eine angemessene Frist gesetzt werden m&uuml;ssen.<br />\nHier wurde jedoch am gleichen Tag ein Reparaturauftrag erteilt, an dem die Heizung ausfiel und der Vermieter zur Beseitigung aufgefordert wurde. Eine hierzu berechtigende Notma&szlig;nahme lag hier nicht vor, da die Heizung nur f&uuml;r eine Tag ausgefallen war und ein weiterer Ausfall durch das h&auml;ufige Nachf&uuml;llen von Wasser verhindert wurde. Eine unmittelbare Instandsetzung sei somit nicht erforderlich.<br />\n&nbsp;<br />\nDie Folge: Der Mieter blieb auf der Rechnung sitzen.<br />\n&nbsp;<br />\nAG Brandenburg, 25.4.2012 - Az: 34 C 45/11<br />\n&nbsp;<br />\n&nbsp; &gt;&gt; Weitere Urteile finden Sie unter <a href=\"http://www.anwon.net/u.asp?x=MR\">http://www.anwon.net/u.asp?x=MR</a><br />\n&nbsp;<br />\n&nbsp; &gt;&gt; Update Mietspiegel-Programm<br />\n&nbsp;<br />\nUnser Mietspiegel-Programm mit Mietspiegeldaten von gut 600 St&auml;dten wurde aktualisiert und kann in der Version 6.34 unter der URL<br />\n&nbsp;<br />\n<a href=\"http://www.anwaltonline.com/mietspiegel/index.html\">http://www.anwaltonline.com/mietspiegel/index.html</a><br />\n&nbsp;<br />\nkostenfrei heruntergeladen werden.<br />\n&nbsp;<br />\n************************************************************************<br />\n&nbsp;<br />\n*2* Das Thema des Monats<br />\n&nbsp;<br />\n&nbsp; &gt;&gt; Dachlawinen und Eiszapfen<br />\n&nbsp;<br />\nImmer wieder kommt es im Winter oder beim Einsetzen des Tauwetters zu<br />\nSach- oder Personensch&auml;den durch abgehende Dachlawinen oder Eiszapfen.<br />\nUmgehend stellt sich f&uuml;r die Betroffenen die Frage nach der Haftung. In dieser Hinsicht gilt zun&auml;chst der Grundsatz, dass der Eigent&uuml;mer daf&uuml;r sorgen muss, dass vom Haus keine Gefahren ausgehen, die zu Sch&auml;den Dritter f&uuml;hren k&ouml;nnen. Im Falle einer Pflichtverletzung kann der Eigent&uuml;mer schadensersatzpflichtig sein. Und wie so h&auml;ufig kommt es hier insbesondere auf das Wort &quot;kann&quot; an. Denn nicht f&uuml;r jeden Schaden kann der Eigent&uuml;mer zur Verantwortung gezogen werden.<br />\n&nbsp;<br />\nDas Ausma&szlig; der Absicherungspflicht vor Dachlawinen ist durchaus umstritten, insbesondere was den vor dem Haus liegenden Stra&szlig;enraum angeht. Oft wird argumentiert, dass Ma&szlig;nahmen nur dann verpflichtend sind, wenn diese wirtschaftlich zumutbar sind. Sind Schneefanggitter nicht orts&uuml;blich, so muss der Eigent&uuml;mer auch keine anbringen, wenn nicht besondere Umst&auml;nde ein solches verlangen und keine Gemeindesatzung oder sonstige &ouml;ffentlich-rechtliche Bauvorschrift bestimmte Sicherungsma&szlig;nahmen vorschreiben. Zu den besonderen Umst&auml;nden kann<br />\ngeh&ouml;ren: regelm&auml;&szlig;ig starker Schneefall, hohes Aufkommen an Fu&szlig;g&auml;ngern vor dem Haus, extreme Dachneigung etc.<br />\n&nbsp;<br />\nDas LG Magdeburg hat in einem Urteil vom 10.11.2010 (Az: 5 O 833/10) entschieden, dass ein Eigent&uuml;mer zumindest teilweise f&uuml;r den Schaden verantwortlich gemacht werden kann, der aufgrund einer Dachlawine an einem parkenden Fahrzeug entstanden ist. Das Gericht war der Ansicht, dass der Eigent&uuml;mer trotz der eigentlichen schneearmen Lage des Objekts<br />\n(Haldensleben) dazu verpflichtet war, vor den Gefahren einer Dachlawine zu warnen, was &uuml;brigens auch dann gelte, wenn der Eigent&uuml;mer nicht vor Ort wohnt. Zwar erkannte das Gericht an, dass in der Gegend keine Verpflichtung zur Anbringung von Schneefanggittern besteht, dennoch seien Benutzer des Stra&szlig;enraums bei ungew&ouml;hnlich starkem Schneefall, der bereits einige Zeit anh&auml;lt, vor den Gefahren zu warnen, wenn diese nicht deutlich erkennbar sind. Das Problem - Dritte sind &uuml;ber Neigungswinkel und ggf. angebrachte Auffanggitter regelm&auml;&szlig;ig nicht informiert. Daher hielt das Gericht vorliegend eine Mithaftung von 50% f&uuml;r angemessen - schlie&szlig;lich hatte der Parkende ja auch Kenntnis der Wetterlage und der Gegebenheiten des Dachs - er wohnte n&auml;mlich gegen&uuml;ber.<br />\n&nbsp;<br />\nIn die gleiche Richtung geht eine Entscheidung des AG Erfurt, in der ausgef&uuml;hrt wurde, dass es keine allgemeine Rechtspflicht f&uuml;r Hauseigent&uuml;mer gibt, Passanten vor herabfallenden Schneemassen zu sch&uuml;tzen. Ist die Wetterlage bekannt, m&uuml;ssen Passanten damit rechnen, dass vom Dach Schnee herabfallen kann, so dass Eigent&uuml;mer f&uuml;r Sch&auml;den einer Schneelawine nicht haften m&uuml;ssen (Az: 214 C 3799/98).<br />\n&nbsp;<br />\nDas AG Spandau war etwas pr&auml;ziser und entschied, dass bei einer Dachschr&auml;ge ab 45&deg; bzw. 50&deg; (so das OLG Dresden - Az: 8 U 696/96) Eigent&uuml;mer zu Schutzma&szlig;nahmen vor Dachlawinen verpflichtet sind(Az: 15 C 26/11). Es gen&uuml;gt dann aber der Verkehrssicherungspflicht, wenn ein Schneefanggitter angebracht wird. Nur wenn besondere Umst&auml;nde dies erforderlich machen, sind weitere Ma&szlig;nahmen erforderlich, so das AG M&uuml;nchen (Az: 132 C 11208/08). Schlie&szlig;lich muss sich grunds&auml;tzlich jedermann auch selbst vor Dachlawinen sch&uuml;tzen.<br />\n&nbsp;<br />\nAuch das AG M&uuml;nchen hat die o.g. Darlegungen letztendlich best&auml;tigt und in einer Entscheidung aus dem Jahr 2011 (Az: 275 C 7022/11) zudem noch mal deutlich gemacht, dass das Abstellen eines Fahrzeugs auf eigenes Risiko erfolgt, wenn Schnee- und Eismassen auf dem Dach erkennbar sind und zudem an der fraglichen Dachseite nicht ger&auml;umt wurde, so dass erkennbar ist, das ein Parken dort nicht gewollt ist.<br />\n&nbsp;<br />\nWas die Warnpflicht angeht, auf die das LG Madgeburg im o.g. Urteil abzielte, so gibt es auch gegenl&auml;ufige Ansichten. Das OLG Hamm hat hierzu entschieden, dass gerade keine Warnpflicht vor etwaigen Dachlawinen besteht, schlie&szlig;lich sei die Gefahrenlage f&uuml;r aufmerksame Verkehrsteilnehmer rechtzeitig erkennbar (Az: I-9 U 119/12), in einer weiteren Entscheidung f&uuml;hrte das Gericht aus, dass Warnhinweise nur bei entspr. ordnungsbeh&ouml;rdliche Vorschriften anzubringen sind (Az: 13 U 49/03). Das AG M&uuml;nchen (Az: 222 C 25801/05) konnte auch keine Pflicht zum Aufstellen von Warnschildern erkennen. &Uuml;ber das Anbringen von Schneefanggittern hinausgehende Schutzma&szlig;nahmen sind vom Eigent&uuml;mer nur bei Vorliegen besonderer Umst&auml;nde zu verlangen. Allein eine extreme Schneelage stellt aber keinen besonderen Umstand dar, ebenso wenig wie eingetretenes Tauwetter. Besch&auml;digungen treten typischerweise in der Folge besonders nachhaltigen Schneeniedergangs oder besonderer Wetterumst&auml;nde ein. Eine besondere Verkehrssicherungspflicht begr&uuml;ndet dies nicht, sonst w&uuml;rde ein Geb&auml;udeeigent&uuml;mer in nahezu allen F&auml;llen haften. Dies st&uuml;nde aber im Gegensatz zu dem Grundsatz, dass es zun&auml;chst einmal Sache des betreffenden Verkehrsteilnehmers selbst ist, sich durch Achtsamkeit vor der Gefahr von Verletzungen oder Sachschaden zu sch&uuml;tzen.<br />\n&nbsp;<br />\n************************************************************************<br />\n&nbsp;<br />\n*3* Mehr von AnwaltOnline<br />\n&nbsp;<br />\n&nbsp; &gt;&gt; Rechtsberatung<br />\n&nbsp;<br />\nBei AnwaltOnline k&ouml;nnen Sie sich direkt von unseren Autoren (zugel.<br />\nRechtsanw&auml;lte) beraten lassen. Kompetent, schnell, unkompliziert u