880,'record_create',NULL,NULL,1,NULL,'Objekte',17,'Manu',1389029233,1389029233,0,0,NULL,NULL,NULL),(881,'record_create',NULL,NULL,1,NULL,'Objekte',18,'Manu',1389029306,1389029306,0,0,NULL,NULL,NULL),(882,'record_create',NULL,NULL,1,NULL,'Objekte',19,'Manu',1389029405,1389029405,0,0,NULL,NULL,NULL),(883,'record_create',NULL,NULL,1,NULL,'Objekte',20,'Manu',1389029600,1389029600,0,0,NULL,NULL,NULL),(884,'record_create',NULL,NULL,1,NULL,'Objekte',21,'Manu',1389029639,1389029639,0,0,NULL,NULL,NULL),(885,'record_create',NULL,NULL,1,NULL,'Objekte',22,'Manu',1389029685,1389029685,0,0,NULL,NULL,NULL),(886,'record_create',NULL,NULL,1,NULL,'Objekte',23,'Manu',1389029742,1389029742,0,0,NULL,NULL,NULL),(887,'record_create',NULL,NULL,1,NULL,'Objekte',24,'Manu',1389029939,1389029939,0,0,NULL,NULL,NULL),(888,'record_create',NULL,NULL,1,NULL,'Objekte',25,'Manu',1389029991,1389029991,0,0,NULL,NULL,NULL),(889,'feed','Social Post',NULL,1,'Keine eigenm&auml;chtiger Kellerr&auml;umung durch Vermieter!<br />\n&nbsp;<br />\nIm zu entscheidenden Fall hat das Gericht einen Vermieter verurteilt, an seine Mieterin 560? Schadensersatz wegen einer unberechtigten Kellerr&auml;umung zu zahlen. Die Kl&auml;gerin hatte in den zu ihrer Wohnung geh&ouml;renden Kellerraum verschiedene Gegenst&auml;nde und ihre Winterschlaf haltende Schildkr&ouml;te eingelagert. Sie hatte zuletzt im Januar 2013 nach ihrer Schildkr&ouml;te Max geschaut, als ihr Lebensgef&auml;hrte etwa 4 Wochen sp&auml;ter nach Max schauen wollte, war der Keller leer ger&auml;umt. Der Vermieter lie&szlig; in diesem Zeitraum den angeblich nicht mit einem Vorh&auml;ngeschloss gesicherten Keller r&auml;umen und die Gegenst&auml;nde, auch die 25-j&auml;hrige Vierzehenschildkr&ouml;te, die sich in der Tiertransportbox befand, auf dem &ouml;rtlichen Bauhof entsorgen. Der Vermieter machte geltend, dass f&uuml;r ihn nicht erkennbar gewesen sei, dass der Keller genutzt wurde. Die T&uuml;r sei unverschlossen gewesen, der Hausmeister habe eine Nachricht an der Kellert&uuml;r angebracht, auf die 3 Wochen niemand reagiert habe. In offen stehende Keller w&uuml;rden andere Mieter M&uuml;ll einlagern, so dass die Beseitigung zur Selbsthilfe erfolgt sei.<br />\n&nbsp;<br />\nDas Gericht hat festgestellt, dass der Vermieter nicht davon ausgehen durfte, dass der Besitz am Keller aufgegeben worden sei, nur weil kein Schloss angebracht gewesen sei. Das Gericht hat durch Zeugenbefragung festgestellt, dass sich in dem Keller diverse Gegenst&auml;nde befanden, die nicht ohne weiteres als wertlos erkennbar waren. Auch durch den an der Kellert&uuml;r angebrachten Zettel ergab sich keine Pflicht der Mieterin zur Reaktion. Das Gericht hat festgestellt, das es &quot;nicht ungew&ouml;hnlich ist, dass Mieter ihnen zugewiesene Kellerr&auml;ume nur in gr&ouml;&szlig;eren Abst&auml;nden anlassbezogen aufsuchen&quot;. Eine R&auml;umung zur Selbsthilfe ist nur zul&auml;ssig, wenn obrigkeitliche Hilfe nicht rechtzeitig erlangt werden kann und ohne sofortiges Eingreifen eine Gefahr besteht. Beides konnte durch das Gericht nicht festgestellt werden.<br />\n&nbsp;<br />\nDas Gericht hat nach ausf&uuml;hrlicher Zeugenbefragung festgestellt, dass die Kl&auml;gerin einen Schaden von 560? erlitten hat, den die Beklagte nun ersetzen muss. Es wurde durch ein Entr&uuml;mplungsunternehmen eine Singlek&uuml;che mit 200?, eine Reisetasche mit 45? und eine Tiertransportbox mit 15? Zeitwert entsorgt. Die Schildkr&ouml;te habe einen Wert von 300? gehabt.<br />\n&nbsp;<br />\nAG Hannover, 6.11.2013 - Az: 502 C 7971/13<br />\nQuelle: PM des AG Hannover<br />\n&nbsp;',NULL,NULL,'Sven',1389085148,1389085148,0,0,NULL,NULL,NULL),(890,'feed','Social Post',NULL,1,'Lauter Jazzkeller - Mietminderung<br />\n&nbsp;<br />\nEin Jazzkeller kann eine 5%ige Mietminderung rechtfertigen, wenn von diesem zwischen 22 und 6 Uhr eine L&auml;rmbel&auml;stigung ausgeht, ohne das ein Baumangel vorliegt und die L&auml;rmgrenze nur vereinzelt &uuml;berschritten wird. Der Vermieter ist n&auml;mlich auch dazu verpflichtet, sorge zu tragen, dass die anderen Mieter durch den L&auml;rm nicht unangemessen gest&ouml;rt werden - auch dann, wenn die Luft- und Trittschalld&auml;mmung des Jazzkellers den Anforderungen der DIN 4109 entspricht.<br />\n&nbsp;<br />\nDa die Grenzwerte der TA-L&auml;rm jedoch &uuml;berschritten wurden - wenn auch nur in vereinzelten Spitzenwerten und nicht dauernd - war eine Mietminderung gerechtfertigt. Das Gericht hielt 5% f&uuml;r angemessen.<br />\n&nbsp;<br />\nLG Berlin, 3.3.2005 - Az: 67 S 238/02<br />\n&nbsp;',NULL,NULL,'Sven',1389085817,1389085817,0,0,NULL,NULL,NULL),(891,'record_create',NULL,NULL,1,NULL,'Objekte',26,'Aziz-Daoudi',1389090070,1389090070,0,0,NULL,NULL,NULL),(892,'record_create',NULL,NULL,1,NULL,'Objekte',27,'Aziz-Daoudi',1389091537,1389091537,0,0,NULL,NULL,NULL),(893,'record_create',NULL,NULL,1,NULL,'Objekte',28,'Aziz-Daoudi',1389091776,1389091776,0,0,NULL,NULL,NULL),(894,'record_create',NULL,NULL,1,NULL,'Objekte',29,'Aziz-Daoudi',1389092730,1389092730,0,0,NULL,NULL,NULL),(895,'record_create',NULL,NULL,1,NULL,'Objekte',30,'Aziz-Daoudi',1389093947,1389093947,0,0,NULL,NULL,NULL),(896,'record_create',NULL,NULL,1,NULL,'Objekte',31,'Aziz-Daoudi',1389094356,1389094356,0,0,NULL,NULL,NULL),(897,'record_create',NULL,NULL,1,NULL,'Objekte',32,'Aziz-Daoudi',1389094931,1389094931,0,0,NULL,NULL,NULL),(898,'record_create',NULL,NULL,1,NULL,'Objekte',33,'Aziz-Daoudi',1389095602,1389095602,0,0,NULL,NULL,NULL),(899,'record_create',NULL,NULL,1,NULL,'Objekte',34,'Aziz-Daoudi',1389097023,1389097023,0,0,NULL,NULL,NULL),(900,'record_create',NULL,NULL,1,NULL,'Objekte',35,'Aziz-Daoudi',1389100484,1389100484,0,0,NULL,NULL,NULL),(901,'record_create',NULL,NULL,1,NULL,'Objekte',36,'Aziz-Daoudi',1389100921,1389100921,0,0,NULL,NULL,NULL),(902,'record_create',NULL,NULL,1,NULL,'Objekte',37,'Aziz-Daoudi',1389101354,1389101354,0,0,NULL,NULL,NULL),(903,'calendar_event',NULL,NULL,1,NULL,'Actions',113,NULL,1389135601,1389112261,0,0,NUL