L,'Actions',135,NULL,1389600022,1389195982,0,0,NULL,NULL,NULL),(925,'calendar_event',NULL,NULL,1,NULL,'Actions',136,NULL,1389799836,1389196056,0,0,NULL,NULL,NULL),(926,'calendar_event',NULL,NULL,1,NULL,'Actions',137,NULL,1389621604,1389196144,0,0,NULL,NULL,NULL),(927,'record_create',NULL,NULL,1,NULL,'Contacts',4337,'Manu',1389197543,1389197543,0,0,NULL,NULL,NULL),(928,'record_create',NULL,NULL,1,NULL,'Objekte',44,'Manu',1389197571,1389197571,0,0,NULL,NULL,NULL),(929,'record_create',NULL,NULL,1,NULL,'Objekte',45,'Manu',1389197811,1389197811,0,0,NULL,NULL,NULL),(930,'record_create',NULL,NULL,1,NULL,'Objekte',46,'Manu',1389200124,1389200124,0,0,NULL,NULL,NULL),(931,'record_create',NULL,NULL,1,NULL,'Objekte',47,'Manu',1389200350,1389200350,0,0,NULL,NULL,NULL),(932,'feed','Social Post',NULL,1,'<u><strong>Neue Funktion:</strong></u><br />\n<br />\nROUTENPLANER - Die Adresse des B&uuml;ros ist als Standart-Adresse angegeben. Somit werden Routen, wenn ben&ouml;tigt, automatisch vom B&uuml;ro zum angegebenen Kontakt berechnet und k&ouml;nnen ausgedruckt werden.<br />\n&nbsp;',NULL,NULL,'admin',1389279387,1389279387,0,0,NULL,NULL,NULL),(933,'calendar_event',NULL,NULL,1,NULL,'Actions',141,NULL,1389888036,1389283896,0,0,NULL,NULL,NULL),(934,'calendar_event',NULL,NULL,1,NULL,'Actions',142,NULL,1389952816,1389346996,0,0,NULL,NULL,NULL),(935,'calendar_event',NULL,NULL,1,NULL,'Actions',143,NULL,1389794439,1389366939,0,0,NULL,NULL,NULL),(936,'calendar_event',NULL,NULL,1,NULL,'Actions',144,NULL,1389610801,1389373021,0,0,NULL,NULL,NULL),(937,'feed','Social Post',NULL,1,'Fliegengitter - erlaubt oder nicht?<br />\n&nbsp;<br />\nMieter d&uuml;rfen Fliegengitter an den Fenstern ihrer Mietwohnung anbringen. Dies geh&ouml;rt zum ordnungsgem&auml;&szlig;en Gebrauch der Mietsache. Der Vermieter ist nicht berechtigt, diese eigenm&auml;chtig zu entfernen (verbotene Eigenmacht). Entfernt der Vermieter die Gitter dennoch, so kann der Mieter die Wiederanbringung derselben vom Vermieter verlangen.<br />\n&nbsp;<br />\nAG Springe, 20.12.2010 - Az: 4 C 292/09<br />\n&nbsp;',NULL,NULL,'Sven',1389604062,1389604062,0,0,NULL,NULL,NULL),(938,'feed','Social Post',NULL,1,'Frau Bader hat wieder angerufen, wollte weiter nichts sagen, schreibt dir aber eine E-Mail und versucht es nochmal irgendwann. Ihre Nummer: 069/98553101',NULL,4,'Manu',1389605342,1389605651,0,0,NULL,NULL,NULL),(939,'record_create',NULL,NULL,1,NULL,'Docs',53,'Manu',1389606334,1389606334,0,0,NULL,NULL,NULL),(940,'calendar_event',NULL,NULL,1,NULL,'Actions',145,NULL,1389978038,1389609159,0,0,NULL,NULL,NULL),(941,'calendar_event',NULL,NULL,1,NULL,'Actions',146,NULL,1389625222,1389610582,0,0,NULL,NULL,NULL),(942,'record_create',NULL,NULL,1,NULL,'Zv',1,'admin',1389611825,1389611825,0,0,NULL,NULL,NULL),(943,'calendar_event',NULL,NULL,1,NULL,'Actions',150,NULL,1390381212,1389619812,0,0,NULL,NULL,NULL),(944,'calendar_event',NULL,NULL,1,NULL,'Actions',151,NULL,1389693648,1389631488,0,0,NULL,NULL,NULL),(945,'calendar_event',NULL,NULL,1,NULL,'Actions',152,NULL,1390035609,1389632289,0,0,NULL,NULL,NULL),(946,'calendar_event',NULL,NULL,1,NULL,'Actions',153,NULL,1390035615,1389633135,0,0,NULL,NULL,NULL),(947,'feed','Social Post',NULL,1,'Unter dem Menupunkt &quot;ZV&quot; findet ihr ein kleines Modul, das zum speichern, hochladen, bearbeiten der ZV-Tabellen gedacht ist. EInfach nur der besseren &Uuml;bersicht halber. Verbesserungsvorschl&auml;ge immer gerne! Aber vielleicht brauchen wir es ja auch nicht, dann entferne ich es gerne wieder. :)<br />\n&nbsp;',NULL,NULL,'Manu',1389634342,1389634342,0,0,NULL,NULL,NULL),(948,'feed','Social Post',NULL,1,'Fenstermodernisierung - Feuchtigkeit und Schimmelbildung<br />\n&nbsp;<br />\nWurden in einer Mietwohnung die Fenster mit dichtschlie&szlig;enden Fenstern ausgetauscht und kommt es deswegen zur Schimmelpilzbildung in der Wohnung, so steht den Mietern nur dann ein Minderungsrecht zu, wenn die Schimmelursache nicht im L&uuml;ftungsverhalten der Mieter zu sehen ist. Dies gilt jedoch nur dann, wenn der Vermieter seiner Aufkl&auml;rungspflicht zum L&uuml;ftungsverhalten, die sich aus dem Einbau der neuen Fenster ergibt, nachgekommen ist. Unterl&auml;sst der Vermieter dieses (so wie vorliegend), so steht dem Mieter selbst bei falschem L&uuml;ftungsverhalten ein Minderungsrecht zu.<br />\n&nbsp;<br />\nKonkret hielt das Gericht vorliegend eine Minderung von 10% f&uuml;r gerechtfertigt.<br />\n&nbsp;<br />\nAG Gotha, 24.3.2003 - Az: 2 C 116/02<br />\n&nbsp;',NULL,NULL,'Sven',1389684791,1389684791,0,0,NULL,NULL,NULL),(949,'calendar_event',NULL,NULL,1,NULL,'Actions',154,NULL,1389693633,1389684873,0,0,NULL,NULL,NULL),(950,'calendar_event',NULL,NULL,1,NULL,'Actions',155,NULL,1390294837,1389687457,0,0,NULL,NULL,NULL),(951,'feed','Social Post',NULL,1,'Hay Musti, Du sollst den Herrn Zieres anrufen, wegen dem Termin am Freitag, da er noch keine Uhrzeit hat.!&nbsp;<br />\n&nbsp;',NULL,5,'Zora ',1389689612,1389689612,0,0,NULL,NULL,NULL),(952,'calendar_event',NULL,NULL,1,NULL,'Actions',156,NULL,1389870024,1389698605,0,0,NULL,NULL,NULL),(953,'feed','Social Post',NULL,0,'Hallo Sven,<br />\n&nbsp;Herr Yigzaw von der Autervermietung hat angerufen. Es geht um dein Mietauto, es ist sehr dringend und du sollst dich heute noch bei ihm melden.<br />\nTel.: 06021335890<br />\n&nbsp;',NULL,4,'Noelle',1389700401,1389700401,0,0,NULL,NULL,NULL),(954,'calendar_event',NULL,NULL,1,NULL,'Actions',157,NULL,1389776458,1389719938,0,0,NULL,NULL,NULL),(961,'calendar_event',NULL,NULL,1,NULL,'Actions',164,NULL,1390312854,1389720535,0,0,NULL,NULL,NULL),(962,'feed','Social Post',NULL,1,'Hay Sven,&nbsp;<br />\nder Herr Ozan von der Firma five-t hat angerufen, wegen der Brosch&uuml;re f&uuml;r die Baugenossenschaft!&nbsp;<br />\nTelefon: 040650565919<br />\n&nbsp;',NULL,4,'Zora ',1389781954,1389781954,0,0,NULL,NULL,NULL),(960,'calendar_event',NULL,NULL,1,NULL,'Actions',163,NULL,1389947439,1389720459,0,0,NULL,NULL,NULL),(963,'feed','Social Post',NULL,1,'Mieter m&uuml;ssen nicht minutenlang auf warmes Wasser warten!<br />\n&nbsp;<br />\nEs ist einem Mieter nicht zuzumuten, dass beim Warmwasser eine Vorlaufzeit von 3-4 Minuten vorliegt, bis das Wasser eine Temperatur von 40&deg;C erreicht hat. Hierbei kommt es jeweils zu einem Wasserverlust von bis zu 40 Litern und entspricht nicht den ma&szlig;geblichen Aussto&szlig;zeiten und Vorlaufmengen f&uuml;r das Warmwasser nach dem Arbeitsblatt W 551. Die Vorlaufmenge bis zur Erw&auml;rmung auf 55&deg;C darf maximal drei Liter betragen. Da dies nicht der Fall war, konnte der Mieter die Miete um 3,5% mindern.<br />\n&nbsp;<br />\nLG Berlin, 2.6.2008 - Az: 67 S 26/07<br />\n&nbsp;',NULL,NULL,'Sven',1389783429,1389783429,0,0,NULL,NULL,NULL),(964,'calendar_event',NULL,NULL,1,NULL,'Actions',165,NULL,1390230018,1389788118,0,0,NULL,NULL,NULL),(965,'record_create',NULL,NULL,1,NULL,'Contacts',4338,'Marvin',1389793369,1389793369,0,0,NULL,NULL,NULL),(966,'calendar_event',NULL,NULL,1,NULL,'Actions',166,NULL,1391695253,1389806573,0,0,NULL,NULL,NULL),(967,'feed','Social Post',NULL,1,'Wenn der Hund eine &Uuml;berschwemmung verursacht ...<br />\n&nbsp;<br />\nIm vorliegenden Fall hatte ein Mieter seinen Hund im G&auml;ste-WC eingesperrt. Der Hund spielte dort mit einer Klopapierrolle, wobei das Papier das Abflussrohr des Waschbeckens verstopfte. Ungl&uuml;cklicherweise &ouml;ffnete das Tier anschlie&szlig;end den Wasserhahn, so dass es in der Folge zu einem erheblichen Wasserschaden kam. Nachdem die Geb&auml;udeversicherung des Vermieters den Schaden reguliert hatte forderte sie das Geld vom Mieter.<br />\nDer Einspruch scheiterte jedoch vor Gericht, da allenfalls vorhersehbar war, dass der Hund mit der Klopapierrolle spielt und diese zerfetzt. Das weitere Geschehen war jedoch als eine Verkettung ungl&uuml;cklicher Umst&auml;nde anzusehen, so dass dem Mieter der Vorwurf grober Fahrl&auml;ssigkeit nicht gemacht werden konnte.<br />\n&nbsp;<br />\nLG Hannover, 23.3.2000 - Az: V 19 S 1968/99<br />\n&nbsp;',NULL,NULL,'Sven',1389857179,1389857179,0,0,NULL,NULL,NULL),(968,'record_create',NULL,NULL,1,NULL,'Contacts',4339,'Marvin',1389859725,1389859725,0,0,NULL,NULL,NULL),(970,'calendar_event',NULL,NULL,1,NULL,'Actions',168,NULL,1390305652,1389865672,0,0,NULL,NULL,NULL),(971,'record_create',NULL,NULL,1,NULL,'Objekte',48,'Manu',1389883514,1389883514,0,0,NULL,NULL,NULL),(972,'calendar_event',NULL,NULL,1,NULL,'Actions',170,NULL,1390323657,1389961018,0,0,NULL,NULL,NULL),(973,'calendar_event',NULL,NULL,1,NULL,'Actions',171,NULL,1390219228,1389961228,0,0,NULL,NULL,NULL),(974,'calendar_event',NULL,NULL,1,NULL,'Actions',172,NULL,1390231815,1389961275,0,0,NULL,NULL,NULL),(975,'calendar_event',NULL,NULL,1,NULL,'Actions',173,NULL,1390482046,1389964006,0,0,NULL,NULL,NULL),(976,'feed','Social Post',NULL,1,'Hallo Sven,<br />\nHerr Bader hat angerufen und bittet um R&uuml;ckruf!!&nbsp;<br />\n&nbsp;',NULL,4,'Zora ',1389967504,1389967504,0,0,NULL,NULL,NULL),(977,'feed','Social Post',NULL,1,'Gartenger&auml;te in der Nebenkostenabrechnung?<br />\n&nbsp;<br />\nDie Kosten f&uuml;r die Anschaffung von Gartenger&auml;ten sind nicht umlagef&auml;hig, da sie nicht f&uuml;r den laufenden Instandhaltungskosten geh&ouml;ren. Der Umstand dass die Kosten der Gartenpflegekosten umlagef&auml;hig sind, bedeutet das nur die laufenden Instandhaltungs- und Betriebskosten umlagef&auml;hig sind. Selbst Ersatzbeschaffungen k&ouml;nnen nicht umgelegt werden.<br />\n&nbsp;<br />\nLG Potsdam, 26.9.2002 - Az: 11 S 81/01<br />\n&nbsp;',NULL,NULL,'Sven',1390204688,1390204688,0,0,NULL,NULL,NULL),(979,'calendar_event',NULL,NULL,1,NULL,'Actions',175,NULL,1390482003,1390208883,0,0,NULL,NULL,NULL),(980,'calendar_event',NULL,NULL,1,NULL,'Actions',176,NULL,1390922156,1390837275,0,0,NULL,NULL,NULL),(981,'calendar_event',NULL,NULL,1,NULL,'Actions',177,NULL,1391590849,1390213250,0,0,NULL,NULL,NULL),(982,'calendar_event',NULL,NULL,1,NULL,'Actions',178,NULL,1390982453,1390213553,0,0,NULL,NULL,NULL),(983,'calendar_event',NULL,NULL,1,NULL,'Actions',179,NULL,1390227352,1390214032,0,0,NULL,NULL,NULL),(984,'calendar_event',NULL,NULL,1,NULL,'Actions',180,NULL,1390312809,1390232170,0,0,NULL,NULL,NULL),(985,'feed','Social Post',NULL,1,'Herr Aschmoneit hat angerufen und bittet um R&uuml;ckruf.<br />\nTel: 015772778730<br />\n&nbsp;',NULL,4,'Zora ',1390300813,1390300813,0,0,NULL,NULL,NULL),(986,'feed','Social Post',NULL,1,'Schimmelpilz - fristlose K&uuml;ndigung?<br />\n&nbsp;<br />\nDie Frage, ob Schimmelpilz in Mietr&auml;umen die Gesundheit der Bewohner gef&auml;hrdet, l&auml;sst sich nicht allgemein beantworten und kann in vielen F&auml;llen nur durch ein medizinisches Sachverst&auml;ndigengutachten gekl&auml;rt werden. Auch eine Einschr&auml;nkung der Nutzungsm&ouml;glichkeit durch die Schimmelbildung war nicht festgestellt worden. Es stand somit im vorliegenden Fall nicht fest, dass die Schimmelbildung in h&ouml;chstem Ma&szlig;e gesundheitssch&auml;digend war, so dass den Mietern kein Recht zur fristlosen K&uuml;ndigung zustand.<br />\nDie Folge: Die Mieter waren verpflichtet, die Miete weiter zu zahlen.<br />\n&nbsp;<br />\nOLG D&uuml;sseldorf, 6.6.2013 - Az: I-10 U 26/13<br />\n&nbsp;<br />\nAnmerkung AnwaltOnline: Statt sofort zu k&uuml;ndigen, w&auml;re der Mangel besser zun&auml;chst angezeigt worden. Hierbei h&auml;tte der Mieter auch eine Minderung ank&uuml;ndigen k&ouml;nnen. Erst wenn der Vermieter unt&auml;tig bleibt w&auml;ren weitere Schritte wie z.B. ein Gutachten angezeigt gewesen.<br />\n&nbsp;',NULL,NULL,'Sven',1390304462,1390304462,0,0,NULL,NULL,NULL),(987,'feed','Social Post',NULL,0,'Hallo Sven,<br />\r\nHerr Jahns von Profikonzept hat angerufen, er w&uuml;rde gerne gemeinsam mit Pfeifer Immobilien ein Gemeinschaftsgesch&auml;ft eingehen. Er wird per Mail ein Expos&eacute; bis heute Abend herausschicken und w&uuml;rde sich sehr freuen wenn du dich bei Interesse zur&uuml;ckmeldest.<br />\r\nHandy: 015253273030',NULL,4,'Noelle',1390312727,1390313144,0,0,NULL,NULL,NULL),(989,'feed','Social Post',NULL,1,'Frau Hermann hat &quot;etwas&quot; genervt angerufen, weil sie mit dir DRINGEND &uuml;ber ihr Projekt (das Bionik-Zentrum) sprechen m&ouml;chte. Sie sucht Jemanden bez&uuml;glich &quot;Projekt-bezogenem Trading&quot;. Du hattest sie (entweder per Mail oder &uuml;ber Herrn Bader) gebeten, ihr Unterlagen zu schicken. Aber bevor sie das tut, m&ouml;chte sie ein kurzes pers&ouml;nliches Gespr&auml;ch f&uuml;hren.<br />\nSie sagt, sie h&auml;tte einen Weg, falls wenn Geld zum investieren vorhanden w&auml;re, das Projekt durchzuf&uuml;hren. Es g&auml;be auch schon Jemanden, der von sich sagt, er k&ouml;nne das Geld aufbringen und innerhalb 1 Jahres w&auml;re es wieder inklusive Gewinn reingeholt.<br />\nPrinzipiell m&ouml;chte Frau Hermann aber erst mit dir vorab, bevor sie detaillierte Unterlagen schickt, dar&uuml;ber sprechen, inwieweit du, deiner Aussage nach gegen&uuml;ber Herrn Bader, die Gelder f&uuml;r dieses Projekt generieren k&ouml;nntest. Frau Hermann sagte auch aus, dass bei erfolgreicher durchf&uuml;hrung des Projektes dann auch alle Beteiligten &quot;gut versorgt&quot; w&auml;ren.<br />\nSie versucht jetzt - ihrer eigenen Angabe nach - seit knapp zwei Wochen dich zu erreichen und ist schon am &uuml;berlegen, ob eine Zusammenarbeit &uuml;berhaupt zustande kommen kann. Da du ihr Projekt aber f&uuml;r hochinteressant h&auml;lst, m&ouml;chte sie nat&uuml;rlich nicht einfach so abspringen, will aber auch nicht noch l&auml;ngere Zeit &quot;hinterher telefonieren&quot;.<br />\n<br />\nIhre Nummer: 0725 15848<br />\n<br />\nSie ist sp&auml;ter mal in einem l&auml;ngeren telefonat, aber ansonsten gut erreichbar (auch abends).<br />\n&nbsp;',NULL,4,'Manu',1390313063,1390366405,0,0,NULL,NULL,NULL),(990,'feed','Social Post',NULL,1,'Ein Herr von der IHK hat angerufen, um zu fragen, ob die Unterlagen zur IHK vollversammlung / Wahl schon eingetroffen seien. Eigentlich wollte er auch nur zur Teilnahme an der Wahl ermutigen, damit die Wahlbeteiligung entsprechend hoch ausf&auml;llt.<br />\n&nbsp;',NULL,4,'Manu',1390313438,1390313438,0,0,NULL,NULL,NULL),(991,'feed','Social Post',NULL,1,'Deine Mutter erbittet R&uuml;ckruf<br />\n&nbsp;',NULL,4,'Manu',1390313598,1390313598,0,0,NULL,NULL,NULL),(992,'feed','Social Post',NULL,0,'Andreas Artuhr der Eigent&uuml;mer der Wohnung am Stuckertsgraben 1 hat angerufen. Er ist umgezogen und m&ouml;chte eine&nbsp;Adress&auml;nderung vornehmen: jetziger Wohnort- Gartenstr.2 63811 Stockstadt<br />\n<br />\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; vorheriger Wohnort- Liebigstr.45 63906 Erlenbach<br />\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\n&nbsp;',NULL,4,'Noelle',1390319006,1390319006,0,0,NULL,NULL,NULL),(993,'comment',NULL,NULL,1,'Guten Morgen Frau Hermann,\n\nSie hatten gestern ein längeres Gespräch mit einem meiner Mitarbeiter (Herr Manz), der mir kurz darüber berichtete. \n\nZuerst einmal möchte ich festhalten, dass ich Ihnen gegenüber in keinerlei Bringschuld stehe. Herr Bader berichtete mir kurz über Ihr Projekt und ich sagte Ihm, dass ich dazu erst einmal Unterlagen benötige. Seit diesem Zeitpunkt versuchen Sie mich zu erreichen. \n\nEin Prüfungsprozess kostet uns intern etwa 25,0 TEUR. Da Sie ja nach eigener Aussage bereits einen Investor haben, sehe ich hier keine Veranlassung mich mit dem Thema zu beschäftigen und Kosten bei uns zu produzieren.\n\nZu unseren Möglichkeiten: unser Auftraggeber hat sich im letzten Jahr an 32 Unternehmen beteiligt, allein in Deutschland. Der Gesamtinvest lag etwa bei rund 220,0 Mio. EUR.\n\nIch wünsche Ihnen bei Ihrem Vorhaben viel Erfolg und hoffe auf gute Geschäfte für Sie!\n\nLiebe Grüße\nIhr\n\n\n\nSven Leudesdorff-Pfeifer\n','Events',989,'Sven',1390366405,1390366405,0,0,NULL,NULL,NULL),(994,'feed','Social Post',NULL,1,'Gl&auml;ubigeranspruch auf Grundbucheinsicht<br />\n&nbsp;<br />\nNach &sect; 12 Abs. 1 GBO ist die Einsicht des Grundbuches jedem gestattet, der ein berechtigtes Interesse darlegt. Ein solches berechtigtes Interesse ist gegeben, wenn zur &Uuml;berzeugung des Grundbuchamtes ein verst&auml;ndiges, durch die Sachlage gerechtfertigtes Interesse des Antragstellers dargetan wird, das sich im Unterschied zum rechtlichen Interesse nicht auf ein bereits vorhandenes Recht oder konkretes Rechtsverh&auml;ltnis st&uuml;tzen muss, sondern auch mit einem blo&szlig; tats&auml;chlichen, insbesondere wirtschaftlichen Interesse begr&uuml;ndet werden kann. Dabei gen&uuml;gt nicht jedes beliebige Interesse; vielmehr muss die Verfolgung unbefugter Zwecke oder reiner Neugier ausgeschlossen werden und die Kenntnis vom Grundbuchstand f&uuml;r den Antragsteller aus sachlichen Gr&uuml;nden f&uuml;r sein k&uuml;nftiges Handeln erheblich erscheinen.<br />\nDiese Voraussetzungen gelten gleicherma&szlig;en auch f&uuml;r die auf eine Kenntniserlangung von einem Kaufpreis abzielende &quot;erweiterte&quot; Grundbucheinsicht in die Grundakten.<br />\nMit der konkreten Darlegung des Zahlungsanspruches und der Vorlage des zugrunde liegenden Vertrages hat der Antragsteller ein berechtigtes Interesse an der Grundbucheinsicht und an der Erteilung der begehrten Ablichtung des Kaufvertrages in ausreichendem Ma&szlig;e nachgewiesen.<br />\n&nbsp;<br />\nOLG Oldenburg, 30.09.2013 - 12 W 261/13<br />\n&nbsp;',NULL,NULL,'Sven',1390367293,1390367293,0,0,NULL,NULL,NULL),(995,'feed','Social Post',NULL,1,'<h2 style=\"box-sizing: border-box; margin: 0px 0px 0.5em; padding: 0px; border: 0px; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 1.25em; line-height: 1.25em; vertical-align: baseline; color: rgb(177, 150, 103); text-transform: uppercase; overflow: hidden; word-wrap: break-word;\">III. ZWEITERWERB DER VORMERKUNG: KURZES SCHEMA</h2>\n\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 0.5em; padding: 0px; border: 0px; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 1em; line-height: 1.5em; vertical-align: baseline; color: rgb(177, 150, 103); text-transform: uppercase; overflow: hidden; word-wrap: break-word;\">1. ABTRETUNGSVERTRAG</h3>\n\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 0.5em; padding: 0px; border: 0px; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 1em; line-height: 1.5em; vertical-align: baseline; color: rgb(177, 150, 103); text-transform: uppercase; overflow: hidden; word-wrap: break-word;\">2. AUSSCHLUSS DER ABTRETUNG</h3>\n\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 0.5em; padding: 0px; border: 0px; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 1em; line-height: 1.5em; vertical-align: baseline; color: rgb(177, 150, 103); text-transform: uppercase; overflow: hidden; word-wrap: break-word;\">3. BERECHTIGUNG BZGL. DER FORDERUNG UND DER VORMERKUNG</h3>\n\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 0.5em; padding: 0px; border: 0px; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 1em; line-height: 1.5em; vertical-align: baseline; color: rgb(177, 150, 103); text-transform: uppercase; overflow: hidden; word-wrap: break-word;\">4. GGF. &Uuml;BERWINDUNG DER NICHTBERECHTIGUNG</h3>\n\n<h2 style=\"box-sizing: border-box; margin: 0px 0px 0.5em; padding: 0px; border: 0px; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 1.25em; line-height: 1.25em; vertical-align: baseline; color: rgb(177, 150, 103); text-transform: uppercase; overflow: hidden; word-wrap: break-word;\">IV. ZWEITERWERB DER VORMERKUNG: SCHEMA MIT ERL&Auml;UTERUNGEN</h2>\n\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 0.5em; padding: 0px; border: 0px; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 1em; line-height: 1.5em; vertical-align: baseline; color: rgb(177, 150, 103); text-transform: uppercase; overflow: hidden; word-wrap: break-word;\">1. ABTRETUNGSVERTRAG</h3>\n\n<p style=\"box-sizing: border-box; margin: 0px 0px 2em; padding: 0px; border: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 0.875em; line-height: 1.9em; vertical-align: baseline; color: rgb(102, 102, 102); text-align: justify; overflow: hidden; word-wrap: break-word;\">Die &Uuml;bertragung der Vormerkung von einer Person auf eine andere erfolgt gem&auml;&szlig; &sect; 401 BGB analog. Wie bereits beim&nbsp;<a href=\"http://www.juraindividuell.de/klausuren/grosser-bgb-schein-klausurfall-auflassungsvormerkung/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline; outline: 0px; color: rgb(140, 104, 177);\">Ersterwerb der Vormerkung</a>&nbsp;erl&auml;utert, handelt es sich bei der Vormerkung um ein streng akzessorisches Sicherungsmittel. Somit geht die Vormerkung bei einer wirksamen Abtretung des zugrundeliegenden Anspruchs (&sect;&sect; 398, 145, 147 BGB) auf den neuen Inhaber &uuml;ber.</p>\n\n<p style=\"box-sizing: border-box; margin: 0px 0px 2em; padding: 0px; border: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 0.875em; line-height: 1.9em; vertical-align: baseline; color: rgb(102, 102, 102); text-align: justify; overflow: hidden; word-wrap: break-word;\"><i style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;\">Bsp.: K hat gegen V einen vormerkungsgesicherten Anspruch auf &Uuml;bertragung eines Grundst&uuml;ckes aus einem Kaufvertrag (&sect; 433 I 1 BGB). Diesen Anspruch tritt er gem&auml;&szlig; &sect; 398 BGB an den B ab. Die Vormerkung folgt automatisch dem Anspruch gem&auml;&szlig; &sect; 401 BGB analog und steht somit dem B zu.</i></p>\n\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 0.5em; padding: 0px; border: 0px; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 1em; line-height: 1.5em; vertical-align: baseline; color: rgb(177, 150, 103); text-transform: uppercase; overflow: hidden; word-wrap: break-word;\">2. KEIN AUSSCHLUSS DER ABTRETUNG (Z.B. &sect; 399 BGB)</h3>\n\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 0.5em; padding: 0px; border: 0px; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 1em; line-height: 1.5em; vertical-align: baseline; color: rgb(177, 150, 103); text-transform: uppercase; overflow: hidden; word-wrap: break-word;\">3. BERECHTIGUNG BZGL. DER FORDERUNG UND DER VORMERKUNG</h3>\n\n<p style=\"box-sizing: border-box; margin: 0px 0px 2em; padding: 0px; border: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 0.875em; line-height: 1.9em; vertical-align: baseline; color: rgb(102, 102, 102); text-align: justify; overflow: hidden; word-wrap: break-word;\">Anders als bei dem Ersterwerb der Vormerkung besteht eine solche beim Zweiterwerb bereits. Deshalb muss der Abtretende beim Zweiterwerb der&nbsp;<a href=\"http://www.juraindividuell.de/artikel/grosser-bgb-schein-vormerkungsklausur/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline; outline: 0px; color: rgb(140, 104, 177);\">Vormerkung</a>&nbsp;eine Berechtigung hinsichtlich der Forderung&nbsp;<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">und</b>&nbsp;der Vormerkung haben.</p>\n\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 0.5em; padding: 0px; border: 0px; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 1em; line-height: 1.5em; vertical-align: baseline; color: rgb(177, 150, 103); text-transform: uppercase; overflow: hidden; word-wrap: break-word;\">4. GGF. &Uuml;BERWINDUNG DER NICHTBERECHTIGUNG</h3>\n\n<p style=\"box-sizing: border-box; margin: 0px 0px 2em; padding: 0px; border: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 0.875em; line-height: 1.9em; vertical-align: baseline; color: rgb(102, 102, 102); text-align: justify; overflow: hidden; word-wrap: break-word;\">Ist eine solche Berechtigung nicht gegeben, muss auch hier gepr&uuml;ft werden, ob eine solche gegebenenfalls &uuml;berwunden werden kann. Wie bereits erl&auml;utert ist der gutgl&auml;ubige&nbsp;<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">Ersterwerb&nbsp;</b>der Vormerkung einhellig anerkannt. Ob jedoch ein gutgl&auml;ubiger&nbsp;<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">Zweiterwerb</b>&nbsp;der Vormerkung m&ouml;glich ist, ist h&ouml;chst umstritten:</p>\n\n<p style=\"box-sizing: border-box; margin: 0px 0px 2em; padding: 0px; border: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 0.875em; line-height: 1.9em; vertical-align: baseline; color: rgb(102, 102, 102); text-align: justify; overflow: hidden; word-wrap: break-word;\"><b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">ACHTUNG:</b>&nbsp;Der gutgl&auml;ubige Zweiterwerb der Vormerkung ist auf jeden Fall dann ausgeschlossen, wenn die Vormerkung aus dem Grunde nicht entstanden ist, weil die zugrundeliegende Forderung nicht existiert. Wie bereits erw&auml;hnt ist die Vormerkung streng akzessorisch und von der Forderung abh&auml;ngig. Einen gutgl&auml;ubigen Forderungserwerb sieht das Gesetzt jedoch nicht vor!!!</p>\n\n<p style=\"box-sizing: border-box; margin: 0px 0px 2em; padding: 0px; border: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 0.875em; line-height: 1.9em; vertical-align: baseline; color: rgb(102, 102, 102); text-align: justify; overflow: hidden; word-wrap: break-word;\"><i style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;\">Bsp.: V hat an K ein Grundst&uuml;ck verkauft und dessen vermeintlichen Anspruch auf &Uuml;bereignung des Grundst&uuml;ckes gem&auml;&szlig; &sect;&nbsp;<a href=\"http://www.juraindividuell.de/artikel/grosser-bgb-schein-nacherfuellung-439-i-bgb-beim-kaufvertrag/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline; outline: 0px; color: rgb(140, 104, 177);\">433 I 1 BGB</a>&nbsp;durch eine Vormerkung sichern lassen. Sp&auml;ter stellt sich heraus, dass V unerkannt geisteskrank ist, so dass ein Anspruch gem. &sect;&sect; 104, 105 BGB nicht zustande gekommen ist. Auch wenn K den vormerkungsgesicherten Anspruch an den gutgl&auml;ubigen D &uuml;bertragen hat erwirbt dieser<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">keine&nbsp;</b>Vormerkung, da es an dem zugrundeliegenden Anspruch fehlt.</i></p>\n\n<p style=\"box-sizing: border-box; margin: 0px 0px 2em; padding: 0px; border: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 0.875em; line-height: 1.9em; vertical-align: baseline; color: rgb(102, 102, 102); text-align: justify; overflow: hidden; word-wrap: break-word;\">In diesem Fall ist ein gutgl&auml;ubiger Zweiterwerb also definitiv und einhellig ausgeschlossen. Existiert die zu besichernde Forderung ist der gutgl&auml;ubige Zweiterwerb aber umstritten:</p>\n\n<ul style=\"box-sizing: border-box; margin: 0px 0px 2em; padding-right: 0px; padding-left: 0px; border: 0px; font-family: Helvetica, Arial, Tahoma, sans-serif; font-size: 16px; line-height: 16px; vertical-align: baseline; list-style: square;\">\n	<li style=\"box-sizing: border-box; margin: 0px 0px 0px 2em; padding: 0px; border: 0px; font-family: inherit; font-size: 0.875em; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: 2.25em; vertical-align: baseline; color: rgb(102, 102, 102); list-style-type: square; word-wrap: break-word;\"><b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">1. Ansicht:&nbsp;</b>Nach einer Auffassung soll der gutgl&auml;ubige Zweiterwerb der Vormerkung nicht m&ouml;glich sein.</li>\n</ul>\n\n<p style=\"box-sizing: border-box; margin: 0px 0px 2em; padding: 0px; border: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 0.875em; line-height: 1.9em; vertical-align: baseline; color: rgb(102, 102, 102); text-align: justify; overflow: hidden; word-wrap: break-word;\">Dies wird damit begr&uuml;ndet, dass der gutgl&auml;ubige Erwerb immer ein &bdquo;Rechtsgesch&auml;ft im Sinne eines Verkehrsgesch&auml;fts&ldquo; voraussetzt. Die Vormerkung geht aber gerade nicht aufgrund eines&nbsp;<a href=\"http://www.juraindividuell.de/artikel/rechtsgeschaeftslehre-teil-3-wirksamwerden-von-willenserklaerungen/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline; outline: 0px; color: rgb(140, 104, 177);\">Rechtsgesch&auml;ftes</a>, sondern durch Gesetzt (&sect; 401 BGB analog) als Folge der Abtretung des zugrundliegenden Anspruchs &uuml;ber. Weiter wird hier angef&uuml;hrt, dass sich die &Uuml;bertragung der Vormerkung wegen &sect; 401 BGB au&szlig;erhalb des Grundbuches vollzieht und es schon an einem Rechtsscheintatbestand fehlt.</p>\n\n<ul style=\"box-sizing: border-box; margin: 0px 0px 2em; padding-right: 0px; padding-left: 0px; border: 0px; font-family: Helvetica, Arial, Tahoma, sans-serif; font-size: 16px; line-height: 16px; vertical-align: baseline; list-style: square;\">\n	<li style=\"box-sizing: border-box; margin: 0px 0px 0px 2em; padding: 0px; border: 0px; font-family: inherit; font-size: 0.875em; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: 2.25em; vertical-align: baseline; color: rgb(102, 102, 102); list-style-type: square; word-wrap: break-word;\"><b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">2. Ansicht:</b>&nbsp;Die herrschende Meinung l&auml;sst den gutgl&auml;ubigen Zweiterwerb der Vormerkung zu.</li>\n</ul>\n\n<p style=\"box-sizing: border-box; margin: 0px 0px 2em; padding: 0px; border: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 0.875em; line-height: 1.9em; vertical-align: baseline; color: rgb(102, 102, 102); text-align: justify; overflow: hidden; word-wrap: break-word;\">Sie h&auml;lt der Gegenansicht entgegen, dass die Vormerkung zwar&nbsp;<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">durch</b>&nbsp;Gesetzt, aber<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">aufgrund&nbsp;</b>&nbsp;eines Rechtsgesch&auml;ftes &ndash; der Abtretung des zugrundeliegenden Anspruchs &ndash; erfolgt. Ein weiterer Grund f&uuml;r die herrschende Meinung liegt auch in der Effizienz der Vormerkung. W&uuml;rde man den gutgl&auml;ubigen Zweiterwerb der Vormerkung nicht zulassen, m&uuml;sste sich der Erwerber jedesmal eine neue Vormerkung auf den Anspruch eintragen lassen. Dies w&uuml;rde die &Uuml;bertragung von Anspruch und Vormerkung in hohem Ma&szlig;e verkomplizieren. Das Argument des fehlenden Rechtsscheintatbestandes entkr&auml;ftet diese Ansicht damit, dass schon die erste Eintragung der Vormerkung einen Rechtsschein setzt.</p>\n\n<p style=\"box-sizing: border-box; margin: 0px 0px 2em; padding: 0px; border: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 0.875em; line-height: 1.9em; vertical-align: baseline; color: rgb(102, 102, 102); text-align: justify; overflow: hidden; word-wrap: break-word;\">Demnach ist der herrschenden Meinung zu folgen und der gutgl&auml;ubige Zweiterwerb der<a href=\"http://www.juraindividuell.de/klausuren/grosser-bgb-schein-klausurfall-auflassungsvormerkung/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline; outline: 0px; color: rgb(140, 104, 177);\">Vormerkung&nbsp;</a>ist gem&auml;&szlig; &sect;&sect; 892, 893 BGB analog zu bejahen.</p>\n\n<p style=\"box-sizing: border-box; margin: 0px 0px 2em; padding: 0px; border: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 0.875em; line-height: 1.9em; vertical-align: baseline; color: rgb(102, 102, 102); text-align: justify; overflow: hidden; word-wrap: break-word;\">Beim gutgl&auml;ubigen Zweiterwerb der Vormerkung muss also nach der Feststellung, dass der Einr&auml;umende nicht berechtigt ist zun&auml;chst gekl&auml;rt werden, ob ein gutgl&auml;ubiger Zweiterwerb&nbsp;<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">&uuml;berhaupt m&ouml;glich</b>&nbsp;ist. Anders als beim gutgl&auml;ubigen Ersterwerb, wo die M&ouml;glichkeit einhellig anerkannt, die&nbsp;<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">dogmatische Herleitung</b>&nbsp;aber umstritten ist.</p>\n<br />\n&nbsp;',NULL,NULL,'Sven',1390369346,1390369346,0,0,NULL,NULL,NULL),(996,'feed','Social Post',NULL,1,'Bohre Brunnen, ehe du Durst hast....<br />\n&nbsp;',NULL,NULL,'Sven',13903695