702,1390926702,0,0,NULL,NULL,NULL),(1040,'calendar_event',NULL,NULL,1,NULL,'Actions',225,NULL,1391086845,1390927845,0,0,NULL,NULL,NULL),(1041,'feed','Social Post',NULL,1,'Zora: Ich habe f&uuml;r Do in den Kalender eine Erinnerung gesetzt - aber da hast du ja Schule. Wenn du diese Woche noch dran denkst, dann mach bitte mit dem Musti ein sch&ouml;nes Foto f&uuml;r die Website, ansonsten machen wir das am Montag. Also nicht &uuml;ber den termin im Kalender wundern ;-)<br />\n&nbsp;',NULL,6,'Manu',1390927970,1390927970,0,0,NULL,NULL,NULL),(1042,'record_create',NULL,NULL,1,NULL,'Contacts',4348,'Marvin',1390982957,1390982957,0,0,NULL,NULL,NULL),(1043,'feed','Social Post',NULL,1,'Errichtung einer Mobilfunksendeanlage auf dem Haus einer Wohnungseigent&uuml;mergemeinschaft<br />\n&nbsp;<br />\nDie Mitglieder einer Wohnungseigent&uuml;mergemeinschaft fassten 2010 mehrheitlich den Beschluss, einem Unternehmen die Aufstellung und den Betrieb einer Mobilfunkanlage auf dem Fahrstuhldach der Wohnungseigentumsanlage zu gestatten. Die Kl&auml;gerin - ebenfalls Mitglied der Wohnungseigent&uuml;mergemeinschaft - ist damit nicht einverstanden. Der von ihr gegen den Beschluss erhobenen Anfechtungsklage haben beide Vorinstanzen mit der Begr&uuml;ndung stattgegeben, die Anbringung der Mobilfunkanlage sei eine bauliche Ver&auml;nderung, die nach &sect; 22 Abs. 1 i.V.m &sect; 14 Nr. 1 WEG der Zustimmung s&auml;mtlicher Wohnungseigent&uuml;mer bedurft h&auml;tte. Mit der Revision m&ouml;chten die Beklagten die Abweisung der Klage erreichen.<br />\n&nbsp;<br />\nDer u.a. f&uuml;r Wohnungseigentumssachen zust&auml;ndige V. Zivilsenat des Bundesgerichtshofs hat die Revision zur&uuml;ckgewiesen und die Rechtsauffassung der Vorinstanzen mit der Erw&auml;gung best&auml;tigt, dass auf der Grundlage des allgemeinkundigen wissenschaftlichen Streits um die von Mobilfunksendeanlagen ausgehenden Gefahren und der daraus resultierenden Bef&uuml;rchtungen zumindest die ernsthafte M&ouml;glichkeit einer Minderung des Miet- oder Verkaufswerts von Eigentumswohnungen besteht. Dies stellt eine Beeintr&auml;chtigung dar, die ein verst&auml;ndiger Wohnungseigent&uuml;mer nicht zustimmungslos hinnehmen muss (&sect; 22 Abs. 1 i.V.m. &sect; 14 Nr. 1 WEG).<br />\n&nbsp;<br />\nEntgegen der Auffassung der Revision ist eine andere Beurteilung auch nicht mit Blick auf die Regelung des &sect; 906 Abs. 1 Satz 2 BGB geboten. Danach besteht zwar im Verh&auml;ltnis benachbarter Grundst&uuml;ckseigent&uuml;mer eine Vermutung daf&uuml;r, dass bestimmte Einwirkungen, zu denen auch Strahlenimmisionen geh&ouml;ren, unwesentlich und daher hinzunehmen sind, wenn die einschl&auml;gigen Grenz- und Richtwerte eingehalten werden. Nicht aber regelt die Norm den Konflikt unter Wohnungseigent&uuml;mern dar&uuml;ber, wie mit dem Gemeinschaftseigentum umgegangen werden soll und ob hierzu bauliche Ver&auml;nderungen mit all ihren Vorz&uuml;gen und Nachteilen vorgenommen werden sollen. Der R&uuml;ckgriff von &sect; 22 Abs. 1 WEG auf den Ma&szlig;stab des &sect; 14 Nr. 1 WEG soll sicherstellen, dass das Recht jedes Wohnungseigent&uuml;mers, auf Entscheidungen &uuml;ber bauliche Ver&auml;nderungen durch das Zustimmungserfordernis ma&szlig;gebend Einfluss zu nehmen (&sect; 903 BGB), grunds&auml;tzlich gewahrt bleibt. In diese Befugnis darf nur eingegriffen werden, soweit Wohnungseigent&uuml;mer von der Ma&szlig;nahme gar nicht oder nur ganz geringf&uuml;gig betroffen sind. F&uuml;r die Konkretisierung dieser spezifisch wohnungseigentumsrechtlichen Geringf&uuml;gigkeit liefern die in &sect; 906 Abs. 1 Satz 2 BGB genannten immissionsrechtlichen Grenz- und Richtwerte keinen brauchbaren Ma&szlig;stab. Das gilt umso mehr, als das Zusammenleben in einer Wohnungseigentumsanlage - auch bei Entscheidungen &uuml;ber bauliche Ver&auml;nderungen - ein st&auml;rkeres Ma&szlig; an R&uuml;cksichtnahme verlangt.<br />\n&nbsp;<br />\nBGH, 24.1.2014 - Az: V ZR 48/13<br />\nQuelle: PM des BGH<br />\n&nbsp;',NULL,NULL,'Sven',1390991526,1390991526,0,0,NULL,NULL,NULL),(1044,'feed','Social Post',NULL,1,'<div class=\"n\" style=\"padding: 5px; color: rgb(102, 102, 102); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 15.399999618530273px; background-color: rgb(230, 230, 230);\">\n<p style=\"margin: 0px; padding: 0px;\"><span style=\"color: rgb(3, 37, 188);\"><strong>BHKW werden zur Zeit stark gef&ouml;rdert, sodass Sie kein Eigenkapital ben&ouml;tigen.&nbsp;Seit dem 1.9.2011 finanziert die kfw Bank des Bundes 100% Ihres BHKWs zu einem Zins von 1 %. Die Durchschnittskosten von 140 &euro; im Monat werden komplett von der&nbsp;<span style=\"color: rgb(253, 4, 10);\"><a href=\"http://www.bafa.de/bafa/de/energie/kraft_waerme_kopplung/stromverguetung/kwk-anlagen_bis_50kw/kwk-zuschlag/index.html\" style=\"color: rgb(219, 47, 44);\" target=\"_blank\"><span style=\"color: rgb(253, 4, 10);\">Bafa&nbsp;<span style=\"color: rgb(3, 37, 188);\">F&ouml;rderung</span></span></a></span>&nbsp;von 5,411 cent die kWh f&uuml;r garantierte 1o Jahre bezahlt. Die gesamte F&ouml;rderung betr&auml;gt z.Z. ca. 12 cent die kWh. So finanziert sich das BHKW durch seine eigene Arbeit und wir &uuml;bernehmen im Instandhaltungsprogram die Auszahlungsgarantie.&nbsp;<a href=\"http://www.energieberatung-duesseldorf.com/kontakt/\" style=\"color: rgb(219, 47, 44);\">Hier erhalten Sie kostenlos Rat</a>.</strong></span></p>\n</div>\n\n<div class=\"n\" style=\"padding: 5px; color: rgb(102, 102, 102); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 15.399999618530273px; background-color: rgb(230, 230, 230);\">\n<h1 style=\"margin: 0px; padding: 0px; font-weight: bold; font-size: 14px; line-height: 19.600000381469727px; color: rgb(0, 0, 0);\">BHKW - Strom und W&auml;rme aus einer Quelle</h1>\n</div>\n\n<div class=\"n\" style=\"padding: 5px; color: rgb(102, 102, 102); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 15.399999618530273px; background-color: rgb(230, 230, 230);\">\n<h2 style=\"margin: 0px; padding: 0px; font-weight: bold; font-size: 12px; line-height: 16.799999237060547px;\">Das Kraftwerk, das sich selbst bezahlt</h2>\n</div>\n\n<div class=\"n\" style=\"padding: 5px; color: rgb(102, 102, 102); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 15.399999618530273px; background-color: rgb(230, 230, 230);\">\n<p style=\"margin: 0px; padding: 0px;\"><span style=\"color: rgb(0, 0, 0);\">Vom Einfamilienhaus (neu) bis zum Mietshaus lohnt sich der Einsatz von Blockheizkraftwerken.&nbsp; Ein BHKW besteht aus einem Verbrennungsmoter, der &uuml;ber einen angeschlossenen Generator Strom erzeugt. Typisch zwischen 1-6 kWel. und 6-15 kW W&auml;rme. Die W&auml;rme ist ein Abfallprodukt,&nbsp;welches das Haus nebenbei auch noch beheizt. Damit ersetzt das BHKW die Heizung. Die Energieausbeute&nbsp;betr&auml;gt in der BHKW Brennwerttechnik nahezu 100 %, in Ihrem Auto nur ca. 40%, bei der alten Gas- oder &Ouml;lheizung ca. 60%.</span><span style=\"color: rgb(0, 0, 0);\">&nbsp;Der generierte Strom deckt den Eigenbedarf und der &Uuml;berschuss wird&nbsp;von den Stadtwerken abgekauft. Dadurch&nbsp;sinkt die Stromrechnung um bis zu 80% und gleichzeitig verdient die Heizung auch noch Geld.</span></p>\n\n<p style=\"margin: 0px; padding: 0px;\"><span style=\"color: rgb(0, 0, 0);\">Durch die bessere Energieeffizienz senkt das BHKW auch die Gas oder Heiz&ouml;lrechnung.</span></p>\n\n<p style=\"margin: 0px; padding: 0px;\"><span style=\"color: rgb(0, 0, 0);\"><strong><em>Wenn die Atomkraftwerke abgeschaltet sind, der Wind nicht bl&auml;st und die Sonne nicht scheint, kommt der Strom aus dem Heizungskeller.</em></strong></span></p>\n\n<p style=\"margin: 0px; padding: 0px;\">&nbsp;</p>\n\n<p style=\"margin: 0px; padding: 0px;\"><span style=\"color: rgb(0, 0, 0);\">Gerne helfen wir Ihnen, &nbsp;Ihr optimales BHKW zu finden. Fordern Sie jetzt eineauf Ihren Energiebedarf abgestimmte&nbsp;﻿kostenlose<strong><a href=\"http://www.energieberatung-duesseldorf.com/kontakt/\" style=\"color: rgb(219, 47, 44);\" target=\"\">Wirtschaftlichkeitsberechnung</a></strong>&nbsp;an.</span></p>\n</div>\n\n<div class=\"n\" style=\"padding: 5px; color: rgb(102, 102, 102); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 15.399999618530273px; background-color: rgb(230, 230, 230);\">\n<h2 style=\"margin: 0px; padding: 0px; font-weight: bold; font-size: 12px; line-height: 16.799999237060547px;\">Zwei Rechenbeispiele:</h2>\n</div>\n\n<div class=\"n\" style=\"padding: 5px; color: rgb(102, 102, 102); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 15.399999618530273px; background-color: rgb(230, 230, 230);\">\n<p style=\"margin: 0px; padding: 0px;\"><strong><a href=\"http://www.energieberatung-duesseldorf.com/video/\" style=\"color: rgb(219, 47, 44);\" target=\"\">Video Dachs G5.5</a></strong></p>\n\n<p style=\"margin: 0px; padding: 0px;\">&nbsp;</p>\n\n<p style=\"margin: 0px; padding: 0px;\"><span style=\"color: rgb(0, 0, 0);\">Beispiel 1:Sie haben j&auml;hrlich einen Strombedarf von&nbsp;8 000 kWh an Strom und einen W&auml;rmebedarf von&nbsp;50 000 kWh. Dann ergiebt sich folgende Kalkulation:</span></p>\n\n<p style=\"margin: 0px; padding: 0px;\">&nbsp;</p>\n\n<p style=\"margin: 0px; padding: 0px;\"><strong><span style=\"color: rgb(0, 0, 0);\"><a href=\"http://www.energieberatung-duesseldorf.com/video/\" style=\"color: rgb(219, 47, 44);\" target=\"\">Video ecopower 1.0</a></span></strong></p>\n\n<p style=\"margin: 0px; padding: 0px;\">&nbsp;</p>\n\n<p style=\"margin: 0px; padding: 0px;\"><span style=\"color: rgb(0, 0, 0);\">Beispiel 2:Sie haben j&auml;hrlich einen Strombedarf von 5000 kWh an Strom und</span></p>\n\n<p style=\"margin: 0px; padding: 0px;\"><span style=\"color: rgb(0, 0, 0);\">einen W&auml;rmebedarf von 35000 kWh. Dann ergiebt sich folgende Kalkulation:</span></p>\n</div>\n\n<div class=\"n\