t;20%</strong></td>\n		</tr>\n		<tr>\n			<td>B2</td>\n			<td>Vaillant</td>\n			<td>ecopower 1.0</td>\n			<td>13 500,-</td>\n			<td><strong>25585,-</strong></td>\n			<td><strong>1739,-</strong></td>\n			<td>\n			<p style=\"margin: 0px; padding: 0px;\"><strong>&gt;20%</strong></p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n</div>\n</div>\n</div>\n<br />\n&nbsp;',NULL,NULL,'Sven',1391013639,1391013639,0,0,NULL,NULL,NULL),(1045,'feed','Social Post',NULL,1,'Stinkende K&uuml;che berechtigt zur Minderung!<br />\n&nbsp;<br />\nIm zu entscheidenden Fall ging es um einen eher ungew&ouml;hnlichen Fall der Geruchsbel&auml;stigung: aus der K&uuml;che der gemieteten Wohnung kamen in Wellen unangenehme Ger&uuml;che (in der Art alten K&auml;ses). Die Mieter fanden das wenig erbaulich und minderten die Miete. Der Vermieter wollte das nicht hinnehmen und klagte auf Zahlung der ausstehenden Betr&auml;ge sowie Erstattung der Kosten f&uuml;r eine Mangelortung (ca. 370 ?).<br />\nDas Gericht stellte sich auf Seiten der Mieter - die Wohnung war mangelhaft, so dass die Minderung berechtig war. Auch die Kosten f&uuml;r die Aufsp&uuml;rung und Bestimmung der Ursache sind vom Vermieter zu tragen, wenn sich nicht die Ursache f&uuml;r die M&auml;ngel von den Mietern zu vertreten ist. Dies war aber hier nicht der Fall gewesen.<br />\n&nbsp;<br />\nAG Suhl, 8.2.2012 - Az: 1 C 419/11<br />\nQuelle: www.anwaltonline.com<br />\n&nbsp;',NULL,NULL,'Sven',1391065340,1391065340,0,0,NULL,NULL,NULL),(1046,'feed','Social Post',NULL,1,'Nochn Bier<br />\r\n&nbsp;',NULL,NULL,'Sven',1391072690,1391072807,0,0,NULL,NULL,NULL),(1047,'media',NULL,NULL,1,'Angehängte Datei:','Media',2132,'Sven',1391072694,1391072694,0,0,NULL,NULL,NULL),(1048,'feed','Social Post',NULL,1,'Nochn Schnaps<br />\n&nbsp;',NULL,NULL,'Sven',1391072755,1391072755,0,0,NULL,NULL,NULL),(1049,'media',NULL,NULL,1,'Nochn Schnaps','Media',2133,'Sven',1391072760,1391072760,0,0,NULL,NULL,NULL),(1050,'feed','Social Post',NULL,1,'<br />\n&nbsp;',NULL,NULL,'Manu',1391084607,1391084607,0,0,NULL,NULL,NULL),(1051,'media',NULL,NULL,1,'Angehängte Datei:','Media',2134,'Manu',1391084607,1391084607,0,0,NULL,NULL,NULL),(1052,'calendar_event',NULL,NULL,1,NULL,'Actions',226,NULL,1391087842,1391087842,0,0,NULL,NULL,NULL),(1053,'calendar_event',NULL,NULL,1,NULL,'Actions',227,NULL,1391087874,1391087874,0,0,NULL,NULL,NULL),(1054,'calendar_event',NULL,NULL,1,NULL,'Actions',228,NULL,1391166055,1391087935,0,0,NULL,NULL,NULL),(1055,'feed','Social Post',NULL,1,'<p style=\"box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-family: \'Open Sans\', sans-serif; line-height: 1.5; vertical-align: baseline; color: rgb(95, 94, 85);\">Die sagenumwobenen&nbsp;<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">Illuminaten</strong>&nbsp;lassen uns auch im Internetzeitalter nicht los &ndash; ganz im Gegenteil, Ger&uuml;chte rund um den Orden haben im Web Hochkonjunktur. Gerade die<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">amerikanische Polit-Elite</strong>&nbsp;wird oft beschuldigt, mit den Illuminaten<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">&nbsp;unter einer Decke zu stecken oder von ihnen kontrolliert zu werden</strong>. Als &bdquo;Beweis&ldquo; wird unter anderem die Abbildung der Pyramide mit dem &bdquo;allsehenden&ldquo; Auge auf dem&nbsp;<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">Dollarschein</strong>&nbsp;genannt &ndash; ein Symbol der Illuminaten (in Wahrheit kann die Pyramide auf verschiedenste Art gedeutet werden und ist nicht ausschlie&szlig;lich mit den Illuminaten verbunden).</p>\n\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-family: \'Open Sans\', sans-serif; line-height: 1.5; vertical-align: baseline; color: rgb(95, 94, 85);\">Zu den &bdquo;Verd&auml;chtigen&ldquo; der Verschw&ouml;rungstheoretiker geh&ouml;rt auch die&nbsp;<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">NSA (National Security Agency), der gr&ouml;&szlig;te Milit&auml;rnachrichtendienst der Vereinigten Staaten</strong>. Offensichtlich als augenzwinkernde Anspielung darauf hat ein gewisser John Fenley aus Utah die Domain<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">itanimulli.com</strong>&nbsp;(&bdquo;Illuminati&ldquo; r&uuml;ckw&auml;rts) registrieren lassen und ganz einfach&nbsp;<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">auf nsa.gov umgeleitet</strong>. Die Registrierung erfolgte am 20. November 2002 via GoDaddy.com. Jeder Nutzer kann eine Domain registrieren und auf eine beliebige Seite umleiten.</p>\n\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-family: \'Open Sans\', sans-serif; line-height: 1.5; vertical-align: baseline; color: rgb(95, 94, 85);\">Der Illuminatenorden wurde &uuml;brigens am&nbsp;<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">1. Mai 1776</strong>&nbsp;in Ingolstadt gegr&uuml;ndet und bereits 1785 in Bayern verboten. Offizielles Ziel des Ordens war es, die &bdquo;<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">Herrschaft von Menschen &uuml;ber Menschen &uuml;berfl&uuml;ssig zu machen</strong>&ldquo;. Seitdem ranken sich zahlreiche Legenden um den Orden, insbesondere, dass er die&nbsp;<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">Weltherrschaft</strong>&nbsp;an sich rei&szlig;en wolle. Durch die Romane von Dan Brown wurden diese Ger&uuml;chte in den letzten Jahren erneut angefacht.</p>\n<br />\n&nbsp;',NULL,NULL,'Sven',1391092140,1391092140,0,0,NULL,NULL,NULL),(1056,'feed','Link',NULL,0,'http://www.immobilienscout24.de/expose/72586870<br />\n&nbsp;',NULL,5,'admin',1391093012,1391093012,0,0,NULL,NULL,NULL);
