INSERT INTO `x2_objekte` VALUES (2,'Anyone','Büroportfolio NRW',NULL,1388683701,1388683756,'Sven','',53,'1800000000.00',0,'6','0.00','Es geht um ein Portfolio von 6 Büroimmobilien mit relativ kurzen Restlaufzeiten. Ausnahme das Objekt in Bonn. Die Vorstellung der Verkäuferin liegt bei der 10 fachen Netto-Ist Miete.\r\nDas entspräche einem Kaufpreis von ca. 25.6 MIO € und einem m² Preis von 1.077,00 €.\r\nAufgrund der kurzen Restlaufzeiten der MV ist das nicht wirklich realistisch. In Düsseldorf läuft der MV im März 2014 aus. Essen Ruhrallee hat noch eine Restlaufzeit von 1,0 Jahren und Essen Bonsiepen von ca. 3 Jahren.  Krefeld von 1,8 Jahren, Duisburg von 2,7. Lediglich in Bonn läuft der MV noch etwa 4,9 Jahre. Berücksichtig werden müssen ausser in Bonn hier die bereits vorhandenen Leerstände. \r\nIch habe für jedes Objekt, entsprechend der Gegebenheiten einen Einzelpreis errechnet und komme auf einen Gesamtkaufpreis von ca. 18.0 MIO €, was einem m² Preis von  766,00 € entspricht. Der Faktor auf Netto-Soll wäre dann 6,3.\r\n','','','','','Erich Podkowa','','','','','',NULL),(3,'Anyone','Aarbergen- 76 Einheiten- auch teilbar',NULL,1389023047,1389023047,'Manu','Aarbergen',65326,'3900000.00',1,'1408','277000.00','Gepflegte Wohnanlage in 65326 Aarbergen, ca. 25 km nordwestlich von Wiesbaden. Die Wohnanlage besteht aus 8\r\nMehrfamilienhäusern ( 3-4 geschossige Gebäude ) mit insgesamt 76 Wohneinheiten. Die Wohnanlage wurde zwischen 1966\r\nund 1968 errichtet. Alle 8 Häuser stehen in einer Strasse. Die Häuser sind in einem gepflegtem und guten Zustand. Aktuell sind\r\n74 Wohnungen vermietet. 2 Wohnungen sind unvermietet. Die meisten Wohnungen verfügen über einen Balkon. Zur Anlage\r\ngehören ca. 80 PKW-Stellplätze und 20 Garagenplätze. Aarbergen ist an den öffentlichen Personennahverkehr durch ein\r\nBusliniennetz der Rheingau-Taunus-Verkehrsgesellschaft angeschlossen. Vor Ort befinden sich kleinere lokale Fachhändler\r\n( Bäckereien und Metzgereien ). Eine Apotheke und Ärzte sind ansässig. Aarbergen - Michelbach verfügt über einen\r\nKindergarten und eine Gesamtschule, welche nur wenige hundert Meter vom Objekt entfernt liegen. Freizeitmöglichkeiten sind\r\nin Form eines Schwimmbades, einer Sporthalle und eines Sportplatzes gegeben. Der größte Arbeitgeber vor Ort ist die Firma\r\nPassavant-Geiger, diese gehört zum Bilfinger Konzern. Modernisierungen: 1987 neue Gaszentralheizung 1991 neue\r\nKunststoffdoppelglasfenster 2009 neuer Fassadenanstrich','5,95% vom Kaufpreis (inkl. MwSt.)\r\n','','','','','','','','','',NULL),(4,'Anyone','Augsburg Klinik',NULL,1389023469,1389023469,'Manu','Augsburg',0,'0.00',1,'0','0.00','Siehe Anhang','','','','','','','','','','',NULL),(5,'Anyone','Berlin Friedrichshain',NULL,1389023575,1389023575,'Manu','Berlin',0,'0.00',0,'0','0.00','','Keine Innenprovision\r\nAußenprovision 50:50 \r\n','','','','Detlef D. Dalke','Sierichstraße 20\r\n22301 Hamburg','+49 (4824) 39 1848','+49 (4824) 3004230 ','dalke-consulting@gmx.com','+49 (172) 413 21 21',NULL),(6,'Anyone','Berlin Hotel',NULL,1389026895,1389026895,'Manu','Berlin',0,'49000000.00',1,'0','0.00','Share Deal möglich! Die Gesellschafter würden zu einem Preis von 2,5 Mio. EUR die Geschäftsanteile verkaufen.','Innenprovision – Keine \r\nAußenprovision – 50:50\r\n','','','','4332','','','','','',NULL),(7,'Anyone','Berlin Immobilien Herr Tilpe',NULL,1389027019,1389115295,'Manu','Berlin',0,'10400000.00',1,'0','584819.17','Mehrere Objekte - Siehe Anhänge','','','','','Tilpe','','','','','',''),(8,'Anyone','Berlin Jobcenter',NULL,1389027768,1389027768,'Manu','Brunsbütteler Damm 75, Berlin',0,'22000000.00',1,'16','1359212.00','Bürogebäude, 5. OG, Baujahr 1999\r\nsehr guter Objektzustand\r\n\r\nnahezu 100% (14.799 m2) vermietet an das Job Center\r\naußerdem 300m2 an ZIZ GmbH\r\nVertrag läuft bis 31.12.2020 plus 2 x 10 Jahre Optionsrecht.\r\nDas Job Center wird gemäß den gesetzlichen Bestimmungen zu\r\n85% von Mitteln des Bundes und zu 15% durch Kommunale Mittel\r\nf